import React, { useEffect, useState } from "react";
import "./Home.css";
// import  from "react-router-dom";
const Home = () => {
  const [slideIndex, setSlideIndex] = useState(0);

  const images = [
    "/image1.jpeg",
    "/image2.jpeg",
    "/image3.webp",
  ];

  useEffect(() => {
    const interval = setInterval(() => {
      setSlideIndex((prev) => (prev + 1) % images.length);
    }, 3000);
    return () => clearInterval(interval);
  }, []);

  const nextSlide = (n) => {
    setSlideIndex((prev) => (prev + n + images.length) % images.length);
  };

  return (
    <div>
      <nav>
        <ul>
          <li><a href="/index">üè† Home</a></li>
          <li>
            <a href="/index">üë§ Owners</a>
            <ul>
              <li><a href="owners/AddOwner">Add Owner</a></li>
              <li><a href="owners/ModifyOwner">Edit Owner</a></li>
              <li><a href="owners/DeleteOwner">Delete Owner</a></li>
              <li><a href="owners/OwnersList">List Owners</a></li>
            </ul>
          </li>
 <li>
            <a href="/index">üè¢ Properties</a>
            <ul>
              <li><a href="property/Add">Add Property</a></li>
              <li><a href="/modify_property">Edit Property</a></li>
              <li><a href="/delete_property">Delete Property</a></li>
              <li><a href="/list_property">List Properties</a></li>
            </ul>
          </li>

          <li>
            <a href="/index">üë• Tenants</a>
            <ul>
              <li><a href="/add_tenant">Add Tenant</a></li>
              <li><a href="/modify_tenant">Edit Tenant</a></li>
              <li><a href="/tenant_delete">Delete Tenant</a></li>
              <li><a href="/tenant_list">List of Tenants</a></li>
            </ul>
          </li>

          {/* <li>
            <a href="/">üìÑ Contracts</a> */}
            {/* <ul>
              <li><a href="#">Add Contract</a></li>
              <li><a href="#">Edit Contracts</a></li>
              <li><a href="#">Delete Contract</a></li>
              <li><a href="#">List Contracts</a></li>
            </ul>
          </li>

          <li>
            <a href="/">üìä Reports</a>
            <ul>
              <li><a href="#">Owner Report</a></li>
              <li><a href="#">Property Report</a></li>
            </ul>
          </li>          ... rest of navbar ... */}
                    <li style={{ marginLeft: "auto" }}>
      <button
        onClick={() => {
          localStorage.removeItem("token"); // Or sessionStorage.clear()
          window.location.href = "/login";  // Redirect to login
        }}
        style={{
          color: "white",
          padding: "20px",
          margin:"0",
          border: "none",
          borderRadius: "5px",
          cursor: "pointer",
          display:"flex",

        }}
      >
         Logout
      </button>
    </li>

        </ul>
      </nav>

      <div style={{ padding: "20px" }}>
        <h2 style={{ textAlign: "center" }}>Welcome to Property Management App</h2>
      </div>

      <div className="slideshow-container">
        {images.map((img, i) => (
          <div
            className="slide"
            style={{ display: slideIndex === i ? "block" : "none" }}
            key={i}
          >
            <img src={img} alt={`Slide ${i + 1}`} />
          </div>
        ))}
<button className="prev" onClick={() => nextSlide(-1)} aria-label="Previous Slide">
  &#10094;
</button>
<button className="next" onClick={() => nextSlide(1)} aria-label="Next Slide">
  &#10095;
</button>
      </div>
    </div>
  );
};

export default Home;
